import React from 'react'
import './App.scss';
import Navigation from './components/Navigation/Navigation'
import Homepage from './components/pages/Homepage';

function App() {
  return (
    <div>
      <header>
          <Navigation className="navigation"/>
      </header>
      <Homepage/>
    </div>
  );
}

export default App;
